equations{ 'subarray1_land_area'} = define() {
	tilt = 0;
	if (${subarray1_track_mode} == 2) { //2-axis tracking
		tilt = 0;
	}
	else if (${subarray1_track_mode} == 4) { //Seasonal tilt
		tilt_monthly = ${subarray1_monthly_tilt};
		tilt = min(tilt_monthly);
	}
	else { //Fixed tilt, single axis, azimuth axis
		tilt = ${subarray1_tilt};
	}

	if ( ${subarray1_shade_mode} == 0 ) {
		aspect = 1.7;
		length = sqrt(${module_area}*aspect);
		nmods = ${subarray1_modules_per_string} * ${subarray1_nstrings} / 2;
		width = sqrt(${module_area}/aspect);
		area = length * ( 3 / ${subarray1_gcr}) * nmods * width; 
		return area;
	}
	else {
		aspect = ${module_aspect_ratio};
		nmods = ${subarray1_nmodx};
		if (${subarray1_mod_orient} == 0)
			width = ${module_width};
		else
			width = ${module_length};
		area = ${ui_subarray1_length_side} * ((${ui_subarray1_nrows}+1) / ${subarray1_gcr}) * nmods * width; 
		return area;
	}
};

